import React from 'react';
import './GameList.css';

class GameList extends React.Component{
    render(){
        return(
            <div id="GameLiet">
                <div className="head">
                    <div className="new-game">New Games</div>
                    <div className="more">More</div>
                </div>
                <div className="game-list">
                    <div className="game-img">img</div>
                    <div>
                        <div className="game-name">Geme Name</div>
                        <div className="game-lv">LV</div>
                        <div className="introduction">简介</div>
                    </div>
                    <div className="more-ico">ico</div>
                </div>
            </div>
        )
    }
}

export default GameList;
